import React from 'react'
import App from 'next/app'
import Head from 'next/head';

class AhaMoments extends App {
  constructor(props) {
    super(props)
  }
  render() {
    const { Component, pageProps } = this.props
    return (
      <div className="wrapper">
      <Head>
        <link href="https://fonts.googleapis.com/css?family=Nunito:700,800,900&display=swap" rel="stylesheet" />
        <link rel="stylesheet" href="https://fonts.googleapis.com/icon?family=Material+Icons" />
        <link rel="stylesheet" href="/css/utils.css" />
        <link rel="stylesheet" href="/css/styles.css" />
      </Head>
      <Component className="wrapper" updateAuth={this.updateAuth} authenticated={this.state.authenticated} {...pageProps} />
      <style jsx>{`
        .wrapper {
          width: 100%;
          margin: 0;
          font-family: 'Nunito', sans-serif;
          min-height: 100%;
        	display: flex;
        }
      `}</style>
      </div>
    )
  }
}

AhaMoments.getInitialProps = async (appContext) => {
  // calls page's `getInitialProps` and fills `appProps.pageProps`
  const appProps = await App.getInitialProps(appContext);

  return { ...appProps }
}

export default AhaMoments
